import React from 'react';
import './App.css';
import AutoExpressAPI from "./API/API";

function App() {

  const {CheckProxy}: AutoExpressAPI = new AutoExpressAPI()
  const result: Response = CheckProxy()

  return (
      <>
        <div>Hello World</div>
        <div>{result}</div>
      </>
  );
}

export default App;
